import React from "react";
import "../Notes";
import "./Note";

function newNotes(nDetail) {
  return (
    <Note
      nkey={nDetail.key}
      nTitle={nDetail.title}
      nContent={nDetail.content}
    />
  );
}

function noteDetails() {
  return <div>{Notes.map(newNotes)}</div>;
}
export default noteDetails;
